import React from 'react';

import './App.css';
import './components/Responsive.css';
import AppRouter from './AppRouter';


function App() {
  return (
    <>
      <div style={{width:'50vh',background:'#ff0000ff',padding:'0.5rem 0',textAlign:'right',position:'fixed',top:0,left:0,zIndex:2000}}>
        <div id="google_translate_element"></div>
      </div>
      <div style={{paddingTop: '2.5rem'}}>
        <AppRouter />
      </div>
    </>
  );
}

export default App;
